import React from 'react';
//import { makeStyles } from '@material-ui/core/styles';
import TableContainer from '@material-ui/core/TableContainer';
import Paper from '@material-ui/core/Paper';

import { Button,Divider,CircularProgress } from '@material-ui/core';
// const useStyles = makeStyles({
//   table: {
//     //minWidth: 650,
//     //height:300,
//   },
// });





export default function BasicTable() {
  //const classes = useStyles();

  return (
    <TableContainer component={Paper} style={{maxHeight:400}}>
    <div style={{display:'flex'}}>
    <div style={{flex:2,marginLeft:5,paddingTop:7}}><p style={{fontSize:18,fontWeight:'bold',}}>Balance Details</p></div>
    <div style={{flex:1,paddingTop:12}}><Button variant="contained" color="inherit"  style={{fontSize:11,textAlign:'center'}}>Submit Verification Documents?</Button></div>
    </div>
    <Divider style={{margin:15}}/>
    <div style={{display:'flex'}}>
    <div style={{flex:1, justifyContent:'center',alignItems:'center',paddingTop:50}}>
    <p style={{color:'darkgray',fontSize:11}}>Account Balance</p>
    <p style={{fontSize:14, fontWeight:'bolder'}}>$45,567822245910 BTC</p>
    <p style={{color:'darkgray',fontSize:11}}>Esitmated value</p>
    <p style={{fontSize:14, fontWeight:'bolder'}}>$456,567,832,822245910</p>
    </div>

    <div style={{flex:1}}>
    <CircularProgress variant="determinate" value={75} size={150} style={{color:'#ffa300',height:250}}/>
    </div>
    </div>
    </TableContainer>

  );
}
